import Button from 'react-bootstrap/Button';
import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

function Header() {
  return (
    <Navbar bg="dark" variant="dark" st="top" className="d-flex justify-content-center">
      <Navbar.Brand href="#home" className="d-flex justify-content-end">
        Incli
      </Navbar.Brand>

      <Button variant="outline-info" className="d-flex justify-content-end">
        Top!
      </Button>
    </Navbar>
  );
}

export default Header;
